const personalDummyGames = [
  {
    boardgameId: 1,
    title: 'Settlers of Catan',
    year_published: 1995,
    complexity: '2.30',
    minplaytime: '69',
    maxplaytime: '420',
    description: 'Catan, previously known as The Settlers of Catan or simply Settlers, is a multiplayer board game designed by Klaus Teuber.'
  },
  {
    boardgameId: 2,
    title: 'Monopoly',
    year_published: 1935,
    complexity: '1.63',
    minplaytime: '69',
    maxplaytime: '420',
    description: 'Monopoly is a multi-player economics-themed board game. In the game, players roll two dice to move around the game board, buying and trading properties and developing them with houses and hotels.'
  },
  {
    boardgameId: 3,
    title: 'Risk',
    year_published: 1959,
    complexity: '2.07',
    minplaytime: '69',
    maxplaytime: '420',
    description: 'Risk is a strategy board game of diplomacy, conflict and conquest[1] for two to six players. The standard version is played on a board depicting a political map of the world, divboardgameIded into 42 territories, which are grouped into six continents.'
  }
];

export default personalDummyGames;
